import React from "react";

export const Login = () => {
    return (
        <form>
            <label htmlFor="email">Email</label><p></p>
            <input onChange={(check_data) => setEmail(check_data.target.value)} type="email" placeholder="Email" /><p></p>
        </form>
    );
}
